import React, { Component, createContext } from 'react'
//import '../App.css'


class Header extends React.Component {
    constructor(props) {
      super(props);
    
  
    }
  
   
  
    render() {
      return (
        <header>
        <div class="main">
            <ul>
                <li><a href="#">Carwale</a></li>
                <li><a href="#"><img src={'images/carwalelogo.png'} width="30" height="30" /></a></li>
                <li><a href="#"><img src={'images/locationLogo.png'} width="30" height="30" /></a></li>
                
            </ul>
        </div>
    </header>
      );
    }
  }
  



export default Header;
